import React from 'react';
import { Navbar } from 'react-bootstrap';

function App() {
  return (
    <div>
      <Navbar fixed="top" bg="dark" variant="dark">

        <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>

      </Navbar>
      <h1>Hello From App</h1>
    </div>
  );
}

export default App;
